(96, 'Ludie', 66, 'delatorre.ludie@msn.com', 'I am contacting you today, because I know the information provided in this massagel could really make a HUGE difference for your Business, so be sure to read every word.\r\n\r\nThe information I provide in this massage could help you get money you probably don’t even know you qualify for and have coming to you.\r\n\r\nYOUR BUSINESS probably already qualifies for ERTC FUNDING  for the W-2 Employees you have employed in your business.\r\n\r\nSo, what is ERTC Funding?\r\n\r\nThe Federal Government has recently amended the CARES Act, and it now makes more businesses eligible to collect the Employee Retention Tax Credit Funds \r\n\r\nthat were originally offered to help businesses that were affected by and qualified for Covid-19 relief.\r\n\r\nBecause of the processing time involved for the ERTC program,\r\n\r\nmost business’s chose to participate in the PPP program, because it got them funding quickly, whereas the ERTC Funding initially took at least 6 months to process and get paid on.\r\n\r\nEven if you previously participated and collected funding under the PPP program, you probably now also qualify to receive additional funding under the ERTC program.\r\n\r\nIf you didn’t participate in the PPP program, then you possibly have an even bigger check with your name on it.\r\n\r\nThe ERTC program has been expanded to help more business owners retain their employees, and it pays you money for the W-2 employees that you had employed and retained during the years  2020- 2021.\r\n\r\nThe qualification for each year is slightly different but depending upon what you paid out to W-2 employees in wages for both years, you could qualify to get back as much as $33,000 PER EMPLOYEE.\r\n\r\nNO that is not a TYPO.You could possibly receive as much as 70% of the wages you paid out, up to $10K PER EMPLOYEE PER QUARTERS 1, 2 & 3 in 2021!\r\n\r\n In most cases, we are talking about a nice big check coming to you as the business owner, so you 